export enum ALERT {
  IDLE = 'Machines are idling too much',
  WEEKEND_OFF = 'This Machine is not supposed to be used on weekends',
  FUEL_LIMIT = 'Fuel left is below 5%',
  ENGINE_FAILED = 'Engine Failed',
}
